import * as FaIcons from "react-icons/fa";
import * as AiIcons from "react-icons/ai";
import * as IoIcons from "react-icons/io";

const SidebarItemsUpper = [
  {
    title: "Profile",
    path: "/",
    name: "",
    icon: <AiIcons.AiFillHome />,
    cName: "nav-text",
  },
  {
    title: "Skills",
    path: "/skills",
    name: "skills",
    icon: <IoIcons.IoIosPaper />,
    cName: "nav-text",
  },
  {
    title: "Projects",
    path: "/projects",
    name: "projects",
    icon: <FaIcons.FaCartPlus />,
    cName: "nav-text",
  },
  {
    title: "Report",
    path: "/report",
    name: "report",
    icon: <FaIcons.FaFile />,
    cName: "nav-text",
  },
];

  const SidebarItemsLower = [
    {
      title: "Sign Out",
      path: "/logout",
      name: "logout",
      icon: <FaIcons.FaSignOutAlt />,
      cName: "nav-text",
    },
  ];

export {
  SidebarItemsUpper
}
